import Header from './Header'
import IoHeartSharp from "react-icons/io5";

const Home = () => {
    return (
        <div>
            <Header />
            <section>
                <p className='slogan bold center'>L'amour en quelques clics...</p>
                <a class="btn btn-light bold" href="#" role="button"><IoHeartSharp />S'inscrire</a>
            </section>
        </div>
    );
}

export default Home
